import { StyleSheet, Dimensions } from "react-native";
const width = Dimensions.get('window').width;

const styles = StyleSheet.create({
    container: {
      alignItems: "center",
      alignSelf: 'stretch',
      flexDirection: "row",
      flexWrap: 'wrap',
      padding: 100
    },
    text: {
        color: "white",
        fontSize: 100,
        fontFamily: 'Saira'
      },
    textContainer:  {
        width: 700
    }
  });

export default styles
